INSERT INTO `appointments` VALUES ('c3b188d3-872d-4647-afc2-343341f9e5a7','Р”РёСЂРµРєС‚РѕСЂ','Директор предприятия относится к категории руководителей.\r\n\r\nНа должность директора предприятия назначается лицо, имеющее высшее профессиональное (техническое или инженерно-экономическое) образование и стаж работы на руководящих должностях в соответ','20000.00','0','1. Директор предприятия относится к категории руководителей.\r\n\r\n2. На должность директора предприятия назначается лицо, имеющее высшее профессиональное (техническое или инженерно-экономическое) образование и стаж работы на руководящих должностях в соответствующей профилю предприятия отрасли не менее 5 лет.\r\n\r\n3. Назначение на должность директора предприятия и освобождение от нее производится решением общего собрания учредителей (иного органа предприятия).\r\n\r\n4. Директор предприятия должен знать:\r\n\r\n4.1. Законодательные и нормативные правовые акты, регламентирующие производственно-хозяйственную и финансово-экономическую деятельность предприятия, постановления федеральных, региональных и местных органов государственной власти и управления, определяющие приоритетные направления развития экономики и соответствующей отрасли.\r\n\r\n4.2. Методические и нормативные материалы других органов, касающиеся деятельности предприятия.\r\n\r\n4.3. Профиль, специализацию и особенности структуры предприятия.\r\n\r\n4.4. Перспективы технического, экономического и социального развития отрасли и предприятия.\r\n\r\n4.5. Производственные мощности и кадровые ресурсы предприятия.\r\n\r\n4.6. Технологию производства продукции предприятия.\r\n\r\n4.7. Налоговое и экологическое законодательство.\r\n\r\n4.8. Порядок составления и согласования бизнес-планов производственно-хозяйственной и финансово-экономической деятельности предприятия.\r\n\r\n4.9. Рыночные методы хозяйствования и управления предприятием.\r\n\r\n4.10. Систему экономических индикаторов, позволяющих предприятию определять свое положение на рынке и разрабатывать программы выхода на новые рынки сбыта.\r\n\r\n4.11. Порядок заключения и исполнения хозяйственных и финансовых договоров.\r\n\r\n4.12. Конъюнктуру рынка.\r\n\r\n4.13. Научно-технические достижения и передовой опыт в соответствующей отрасли производства.\r\n\r\n4.14. Управление экономикой и финансами предприятия.\r\n\r\n4.15. Организацию производства и труда.\r\n\r\n4.16. Порядок разработки и заключения отраслевых тарифных соглашений, коллективных договоров и регулирования социально-трудовых отношений.\r\n\r\n4.17. Трудовое законодательство.\r\n\r\n4.18. Правила и нормы охраны труда.\r\n\r\n5. Директор предприятия подотчетен учредителям предприятия в лице (общего собрания акционеров; иного органа).\r\n\r\n6. На время отсутствия директора предприятия его должностные обязанности выполняет (ют) заместитель(и), назначаемый в установленном порядке, который(е) несет(ут) ответственность за качественное, эффективное и своевременное их выполнение.\r\nII. Должностные обязанности \r\n\r\nДиректор предприятия:\r\n\r\n1. Руководит в соответствии с действующим законодательством производственно-хозяйственной и финансово-экономической деятельностью предприятия, неся всю полноту ответственности за последствия принимаемых решений, сохранность и эффективное использование имущества предприятия, а также финансово-хозяйственные результаты его деятельности.\r\n\r\n2. Организует работу и эффективное взаимодействие всех структурных подразделений, цехов и производственных единиц, направляет их деятельность на развитие и совершенствование производства с учетом социальных и рыночных приоритетов, повышение эффективности работы предприятия, рост объемов сбыта продукции и увеличение прибыли, качества и конкурентоспособности производимой продукции, ее соответствие мировым стандартам в целях завоевания отечественного и зарубежного рынка и удовлетворения потребностей населения в соответствующих видах отечественной продукции.\r\n\r\n3. Обеспечивает выполнение предприятием всех обязательства перед федеральным, региональным и местным бюджетами, государственными внебюджетными социальными фондами, поставщиками, заказчиками и кредиторами, включая учреждения банка, а также хозяйственных и трудовых договоров (контрактов и бизнес-планов).\r\n\r\n4. Организует производственно-хозяйственную деятельность на основе широкого использования новейшей техники и технологии, прогрессивных форм управления и организации труда, научно-обоснованных нормативов материальных, финансовых и трудовых затрат, изучения конъюнктуры рынка и передового опыта (отечественного и зарубежного) в целях всемерного повышения технического уровня и качества продукции (услуг), экономической эффективности ее производства, рационального использования производственных резервов и экономного расходования всех видов ресурсов.\r\n\r\n5. Принимает меры по обеспечению предприятия квалифицированными кадрами, рациональному использованию и развитию их профессиональных знаний и опыта, созданию безопасных и благоприятных для жизни и здоровья условий труда, соблюдению требований законодательства об охране окружающей среды.\r\n\r\n6. Обеспечивает правильное сочетание экономических и административных методов руководства, единоначалия и коллегиальности в обсуждении и решении вопросов, материальных и материальных стимулов повышения эффективности производства, применение принципа материальной заинтересованности и ответственности каждого работника за порученное ему дело и результаты работы всего коллектива, выплату заработной платы в установленные сроки.\r\n\r\n7. Совместно с трудовыми коллективами и профсоюзными организациями обеспечивает на основе принципов социального партнерства разработку, заключение и выполнение коллективного договора, соблюдение трудовой дисциплины, способствует развитию трудовой мотивации, инициативы и активности рабочих и служащих предприятия.\r\n\r\n8. Решает вопросы, касающиеся финансово-экономической и производственно-хозяйственной деятельности предприятия, в пределах предоставленных ему законодательством прав, поручает ведение отдельных направлений деятельности другим должностным лицам – заместителям директора, руководителям производственных единиц и филиалов предприятий, а также функциональных и производственных подразделений.\r\n\r\n9. Обеспечивает соблюдение законности в деятельности предприятия и осуществлении его хозяйственно экономических связей, использование правовых средств для финансового управления и функционирования в рыночных условиях, укрепления договорной и финансовой дисциплины, регулирования социально-трудовых отношений, обеспечения инвестиционной привлекательности предприятия в целях поддержания и расширения масштабов предпринимательской деятельности.\r\n\r\n10. Соблюдает требования охраны труда, установленные законами и иными нормативными правовыми актами, а также правилами и инструкциями по охране труда.\r\n\r\n11. Защищает имущественные интересы в суде, арбитраже, органов государственной власти и управления.\r\nIII. Права \r\n\r\nДиректор предприятия имеет право:\r\n\r\n1. Без доверенности действовать от имени предприятия.\r\n\r\n2. Представлять интересы предприятия во взаимоотношениях с гражданами, юридическими лицами, органами государственной власти и управления.\r\n\r\n3. Распоряжаться имуществом и средствами предприятия с соблюдением требований, определенных законодательством, Уставом предприятия, иными нормативными правовыми актами.\r\n\r\n4. Открывать в банковских учреждениях расчетный и другие счета.\r\n\r\n5. Заключать трудовые договоры.\r\n\r\n6. Принимать решения по представлениям: о привлечении работников, нарушивших производственную и трудовую дисциплину, виновных в причинении материального ущерба предприятию к материальной и дисциплинарной ответственности; о моральном и материальном поощрении особо отличившихся работников.\r\n\r\n7. Выдавать доверенности на совершение гражданско-правовых сделок, представительство, пр.\r\n\r\n8. В пределах, установленных законодательством, определять состав и объем сведений, составляющих коммерческую тайну, порядок ее защиты.\r\nIV. Ответственность \r\n\r\n1. Директор предприятия несет ответственность:\r\n\r\n1.1. За ненадлежащее исполнение или неисполнение своих должностных обязанностей, предусмотренных настоящей должностной инструкцией - в пределах, определенных действующим трудовым законодательством Российской Федерации.\r\n\r\n1.2. За правонарушения, совершенные в процессе осуществления своей деятельности – в пределах, определенных действующим административным, уголовным и гражданским законодательством Российской Федерации.\r\n\r\n1.3. За причинение материального ущерба – в пределах, определенных действующим трудовым и гражданским законодательством Российской Федерации.\r\n\r\n2. Директор предприятия несет персональную ответственность за последствия принятых им решений, выходящих за пределы его полномочий, установленных действующим законодательством, Уставом предприятия, иными нормативными правовыми актами. Директор предприятия не освобождается от ответственности, если действия, влекущие ответственность, были предприняты лицами, которым он делегировал свои права.\r\n\r\n3. Директор предприятия, недобросовестно использующий имущество и средства предприятия в собственных интересах или в интересах противоположных интересам учредителей, несет ответственность в пределах, определенных гражданским, уголовным, административным правом.\r\n\r\nДолжностная инструкция разработана в соответствии с установленными требованиями.'),('e0abb512-9d93-4c76-889c-d8607857efad','РСЃРїРѕР»РЅРёС‚РµР»СЊРЅС‹Р№ СЃРѕС‚СЂСѓРґРЅРёРє','Обязанности работника\r\nдобросовестно исполнять свои трудовые обязанности, возложенные на него трудовым договором; \r\nсоблюдать правила внутреннего трудового распорядка организации; \r\nсоблюдать трудовую дисциплину; \r\nвыполнять установленные нормы труда; \r\n','11000.00','10.00','   Добросовестно исполнять свои трудовые обязанности, возложенные на него трудовым договором; \r\nсоблюдать правила внутреннего трудового распорядка организации; \r\nсоблюдать трудовую дисциплину; \r\nвыполнять установленные нормы труда; \r\nсоблюдать требования по охране труда и обеспечению безопасности труда; \r\nбережно относиться к имуществу работодателя и других работников; \r\nнезамедлительно сообщить работодателю либо непосредственному руководителю о возникновении ситуации, представляющей угрозу жизни и здоровью людей, сохранности имущества работодателя.'),('3f8ca833-200c-4d1c-9586-807a4baa4faf','РњРµРЅРµРґР¶РµСЂ РїРѕ СЂР°Р±РѕС‚Рµ СЃ РєР»РёРµРЅС‚Р°РјРё','Менеджер по работе с клиентами относится к категории руководителей.\r\nНа должность менеджера по работе с клиентами назначается лицо, имеющее высшее образование','10000.00','6','ДОЛЖНОСТНАЯ ИНСТРУКЦИЯ	\r\n\r\nменеджеру по работе с клиентами	\r\n\r\nI. Общие положения \r\nМенеджер по работе с клиентами относится к категории руководителей.\r\nНа должность менеджера по работе с клиентами назначается лицо, имеющее \r\n___________________________________\r\n(высшее; среднее)\r\nпрофессиональное (экономическое) образование, дополнительную подготовку по менеджменту, стаж работы в сфере предпринимательства не менее \r\n___________________________________.\r\n(3 лет; 5 лет; др.)\r\nМенеджер по работе с клиентами должен знать:\r\n3.1. Законодательство, регламентирующее вопросы осуществления предпринимательской деятельности.\r\n3.2. Рыночную экономику, предпринимательство и основы ведения бизнеса.\r\n3.3. Основы маркетинга (концепцию маркетинга, основы управления маркетингом, способы и направления исследований рынка).\r\n3.4. Теорию менеджмента, макро— и микроэкономики, делового администрирования.\r\n3.5. Ассортимент, классификацию, характеристику и назначение предлагаемых товаров (продукции).\r\n3.6. Порядок разработки бизнес-планов и коммерческих условий соглашений, договоров.\r\n3.7. Правила установления деловых контактов.\r\n3.8. Правила официального этикета при проведении переговоров с клиентами. \r\n3.9. Теорию межличностного общения.\r\n3.10. Основы социологии и психологии.\r\n3.11. Методы обработки информации с использованием современных технических средств коммуникации и связи, компьютера.\r\nНазначение на должность менеджера по работе с клиентами и освобождение от должности производится приказом руководителя предприятия по представлению\r\n______________________________________________.\r\n(коммерческого директора предприятия; иного должностного лица)\r\nМенеджер по работе с клиентами подчиняется непосредственно \r\n______________________________________________.\r\n(коммерческому директору предприятия; иному должностному лицу)\r\nНа время отсутствия менеджера по работе с клиентами (отпуск, болезнь, пр.) его обязанности выполняет лицо, назначенное в установленном порядке. Данное лицо приобретает соответствующие права и несет ответственность за ненадлежащее исполнение возложенных на него обязанностей.\r\n\r\n \r\n\r\nII. Должностные обязанности \r\n\r\nМенеджер по работе с клиентами:\r\nОсуществляет анализ аудитории потенциальных клиентов, выявляет потребности клиентов, их уровень и направленность.\r\nРазрабатывает методики поиска клиентов, планирует работу с клиентами, составляет схемы обращения к клиентам.\r\nНепосредственно осуществляет поиск клиентов всеми доступными способами (путем размещения рекламы, участия в выставках, ярмарках, презентациях, направления предложений по средствам коммуникаций, электронной почтой, факсимильными сообщениями, пр.).\r\nПрогнозирует деловую надежность потенциальных клиентов, их финансовую и материальную обеспеченность.\r\nОрганизует и проводит предварительные переговоры с клиентами, заинтересовавшимися предложениями (принявшими оферту, пр.), уточняет потребности каждого конкретного клиента и подготавливает предложение, адресованное определенному клиенту.\r\nВстречается с клиентами, убеждает клиентов в выгодности предложения, предлагает на обсуждение и согласование проекты договоров, принимает участие в работе над согласованием разногласий, заключает договоры от имени предприятия.\r\nПредлагает клиентам пути решения не согласованных при переговорах вопросов и вопросов, возникших после совершения юридически значимых действий.\r\nПоддерживает постоянный контакт с существующими клиентами, организует работу с ними по устоявшимся деловым схемам.\r\nРазрабатывает схемы взаимоотношений с наиболее выгодными и перспективными клиентами (предложения особых условий договоров, систем скидок и индивидуального обслуживания, ускоренных сроков и особых условий исполнения договорных обязательств, пр.).\r\nРазрабатывает и дает клиентам рекомендации и консультации по наиболее эффективному использованию устоявшихся деловых связей; обеспечивает возможность посещения клиентами выставок, ярмарок, презентаций новых продуктов (товаров, услуг).\r\nОбеспечивает соблюдение интересов клиентов при выполнении условий договоров подразделениями предприятия.\r\nНалаживает обратную связь с клиентами (изучает их требования к продукции (товарам, услугам), устанавливает причины неудовлетворенности клиента совместной работой, анализирует претензии клиентов и принимает все меры по их решению и сохранению деловых связей).\r\nФормирует банк данных о клиентах (клиентскую базу), своевременно вносит в нее изменения.\r\nИзучает и анализирует политику конкурентов во взаимоотношениях с клиентами.\r\n\r\n \r\n\r\nIII. Права \r\n\r\nМенеджер по работе с клиентами имеет право:\r\nСамостоятельно определять формы работы с клиентами, способы установления деловых связей.\r\nРаспоряжаться вверенными ему финансовыми средствами (на представительские расходы).\r\nПодписывать и визировать документы в пределах своей компетенции.\r\nЗнакомиться с документами, определяющими его права и обязанности по занимаемой должности, критерии оценки качества исполнения должностных обязанностей.\r\nЗапрашивать от руководства и специалистов подразделений предприятия информацию и документы, необходимые для выполнения его должностных обязанностей.\r\nТребовать от руководства предприятия обеспечения организационно-технических условий и оформления установленных документов, необходимых для исполнения должностных обязанностей.\r\n\r\n \r\n\r\nIV. Ответственность \r\n\r\nМенеджер по работе с клиентами несет ответственность:\r\nЗа ненадлежащее исполнение или неисполнение своих должностных обязанностей, предусмотренных настоящей должностной инструкцией, — в пределах, установленных действующим трудовым законодательством Российской Федерации.\r\nЗа правонарушения, совершенные в процессе своей деятельности, — в пределах, установленных действующим административным, уголовным и гражданским законодательством Российской Федерации.\r\nЗа причинение материального ущерба предприятию — в пределах, установленных действующим трудовым и гражданским законодательством Российской Федерации.\r\n\r\n \r\n 	\r\n 	\r\n 	\r\n 	\r\n \r\n\r\n 	\r\n 	\r\n_____________	\r\n 	\r\n____________________\r\n\r\n(составитель должностной инструкции)	\r\n 	\r\n(подпись)	\r\n 	\r\n(расшифровка подписи)\r\n\r\n 	\r\n 	\r\n00.00.200_г	\r\n 	\r\n \r\n\r\n 	\r\n 	\r\n 	\r\n 	\r\n \r\n\r\n 	\r\n 	\r\n 	\r\n 	\r\n \r\n\r\n(лицо, визирующее должностную инструкцию)	\r\n 	\r\n 	\r\n 	\r\n \r\n\r\n______________	\r\n 	\r\n____________________	\r\n 	\r\n 	\r\n 	\r\n \r\n\r\n(подпись)	\r\n 	\r\n(расшифровка подписи)	\r\n 	\r\n 	\r\n 	\r\n \r\n\r\n00.00.200_г	\r\n 	\r\n 	\r\n 	\r\n '),('eda27ae4-6bc1-4f18-ba0b-fbda08cbd49a','РќР°С‡Р°Р»СЊРЅРёРє РѕС‚РґРµР»Р°','В обязанности входит\r\n-Управление предпринимательской или коммерческой деятельностью \r\nпредприятия. \r\n- Взаимодействие с представителями сторонних организаций в \r\nпроцессе выполнения функциональных обязанностей. \r\n- Подбор и расстановка кадров, стимулиро','12000.00','2','1. Планирование продаж\r\n\r\nДля рационального планирования начальнику отдела продаж необходима полная информация о продажах за прошедший период: работа торговых точек и филиалов, объём продаж по разным категориям товаров, результативность продаж менеджеров. Все эти данные, а также многие другие представляет вам система 24com. С помощью этого модуля отчётов вы сможете составлять маркетинговый бюджет и планировать траты на рекламу и продвижение продукции.\r\n\r\n \r\n2. Совершенствование сервиса\r\n\r\nКонечно, любой ваш менеджер – человек со сложившимися чертами характера, убеждениями и привычками, изменить которые практически невозможно. Но начальник отдела продаж должен заботиться о том, чтобы каждый клиент компании был обслужен на высоком уровне вне зависимости от личности и квалификации сотрудника. Система учёта 24com поможет вам сформулировать требования к уровню обслуживания клиентов и контролировать их выполнение каждым менеджером.\r\n\r\n \r\n3. Начальник отдела продаж, мотивируй сотрудников!\r\n\r\nСложились несколько систем материальной мотивации сотрудников, работающих с клиентами. Неизменная ставка и изменяющийся в зависимости от объёма продаж процент - самая известная, но и самая несовершенная система поощрения, ведь при таком подходе менеджер неохотно берётся за выполнение небольших заказов! Налицо – столкновение интересов компании и сотрудника. Чтобы этого избежать, воспользуйтесь системой отчётов 24com, где подробные данные о продажах дадут возможность анализировать информацию и давать бонусы за реальные заслуги, например, за качественное привлечение и проведение клиента. Также начальник отдела продаж сможет установить процент поощрения менеджера, зависящий не только от объёма продаж, но и от маржи или других показателей.\r\n\r\n \r\n4. Эффективное управление отделом продаж\r\n\r\nОдна из обязанностей начальника отдела продаж - чётко контролировать текущую работу каждого сотрудника. Но делать это нужно эффективно. Отчётность 24com поможет в этом, вам даже не надо будет отходить от вашего компьютера! Если вы пользуетесь системой 24com, то имеете возможность полностью контролировать работу своего отдела и каждого менеджера, имея доступ к всемирной связи. Передавать полномочия, поручать дела, следить за ходом их выполнения – вот неполный список того, что вы сможете делать. Система 24com поможет вам как в долгосрочном планировании работы отдела, так и в текущих ежедневных делах.'),('b74fa7ce-ae24-4f84-b5b1-0ff1ec04fc12','РЎС‚Р°СЂС€РёР№ РјРµРЅРµРґР¶РµСЂ',' На должность менеджера назначается лицо, имеющее высшее \r\nпрофессиональное образование (по специальности менеджмент) или высшее \r\nпрофессиональное образование и дополнительную подготовку в области теории \r\nи практики менеджмента, ','15000.00','3','Должностная инструкция \r\nменеджера 1\r\n______________________________________________ \r\n(наименование организации, предприятия и т.п.) \r\n\r\n\" \" ____________ 20__г. N__________ \r\n\r\n\r\nНастоящая должностная инструкция разработана и утверждена на \r\nосновании трудового договора с __________________________________________ \r\n(наименование должности лица, на которого \r\n______________________________________________________ и в соответствии с \r\nсоставлена настоящая должностная инструкция) \r\nположениями Трудового кодекса Российской Федерации и иных нормативных \r\nактов, регулирующих трудовые правоотношения в Российской Федерации. \r\n\r\nI. Общие положения \r\n\r\n1.1. Менеджер относится к категории руководителей. Принимается на \r\nработу и увольняется с нее приказом директора предприятия. \r\n1.2. Менеджер непосредственно подчиняется __________________________ \r\n________________________________________________________________________. \r\n1.3. На должность менеджера назначается лицо, имеющее высшее \r\nпрофессиональное образование (по специальности менеджмент) или высшее \r\nпрофессиональное образование и дополнительную подготовку в области теории \r\nи практики менеджмента, стаж работы по специальности не менее_______ лет. \r\n1.4. Во время отсутствия менеджера (командировка, отпуск, болезнь и \r\nпр.) его должностные обязанности выполняет заместитель, назначаемый в \r\nустановленном порядке, который несет полную ответственность за качество и \r\nсвоевременность их выполнения. \r\n1.5.В своей деятельности менеджер руководствуется: \r\n- законодательными и нормативными документами по вопросам \r\nпредпринимательской и коммерческой деятельности; \r\n- методическими материалами, касающимися соответствующих вопросов; \r\n- уставом предприятия; \r\n- правилами трудового распорядка; \r\n- приказами, распоряжениями директора предприятия, непосредственного \r\nруководителя; \r\n- настоящей должностной инструкцией. \r\n1.6. Менеджер должен знать: \r\n- законодательные и нормативные акты, регулирующие \r\nпредпринимательскую деятельность; \r\n- рыночную экономику, предпринимательство и ведение бизнеса; \r\n- конъюнктуру рынка, порядок ценообразования, налогообложения, \r\nосновы маркетинга; \r\n- теорию менеджмента, макро- и микроэкономики, делового \r\nадминистрирования, биржевого, страхового, банковского и финансового дела; \r\n- теорию и практику работы с персоналом; \r\n- формы и методы ведения рекламных кампаний; \r\n- порядок разработки бизнес-планов и коммерческих условий \r\nсоглашений, договоров, контрактов; \r\n- основы социологии, психологии и мотивации труда; \r\n- этику делового общения; \r\n- основы технологии производства; \r\n- структуру управления предприятием, перспективы инновационной и \r\nинвестиционной деятельности; \r\n- методы оценки деловых качеств работников; \r\n- основы делопроизводства; \r\n- методы обработки информации с использованием современных \r\nтехнических средств, коммуникаций и связи, вычислительной техники; \r\n- законодательство о труде; \r\n- передовой отечественный и зарубежный опыт в области менеджмента; \r\n- правила и нормы охраны труда. \r\n\r\nII. Функции \r\n\r\nНа менеджера возлагаются следующие функции: \r\n2.1. Управление предпринимательской или коммерческой деятельностью \r\nпредприятия. \r\n2.2. Взаимодействие с представителями сторонних организаций в \r\nпроцессе выполнения функциональных обязанностей. \r\n2.3. Подбор и расстановка кадров, стимулирование качества труда. \r\n2.4. Организация рекламной деятельности. \r\n\r\nIII. Должностные обязанности \r\n\r\nДля выполнения возложенных на него функций менеджер обязан: \r\n3.1. Осуществлять управление предпринимательской или коммерческой \r\nдеятельностью предприятия, направленной на удовлетворение нужд \r\nпотребителей и получение прибыли за счет стабильного функционирования, \r\nподдержания деловой репутации и в соответствии с предоставленными \r\nполномочиями и выделенными ресурсами. \r\n3.2. Исходя из стратегических целей деятельности предприятия, \r\nпланировать предпринимательскую деятельность. \r\n3.3. Осуществлять контроль за разработкой и реализацией \r\nбизнес-планов и коммерческих условий, заключаемых соглашений, договоров и \r\nконтрактов, оценивать степень возможного риска. \r\n3.4. Анализировать и решать организационно-технические, \r\nэкономические, кадровые и социально-психологические проблемы в целях \r\nстимулирования производства и увеличения объема сбыта продукции, \r\nповышения качества и конкурентоспособности товаров и услуг, экономного и \r\nэффективного использования материальных, финансовых и трудовых ресурсов. \r\n3.5. Осуществлять подбор и расстановку кадров, мотивацию их \r\nпрофессионального развития, оценку и стимулирование качества труда. \r\n3.6. Организовывать связи с деловыми партнерами, систему сбора \r\nнеобходимой информации и расширения внешних связей и обмена опытом. \r\n3.7. Осуществлять анализ спроса на производимую продукцию или \r\nуслуги, прогноз и мотивацию сбыта посредством изучения и оценки \r\nпотребностей покупателей. \r\n3.8. Участвовать в разработке инновационной и инвестиционной \r\nдеятельности, рекламной стратегии, связанной с развитием \r\nпредпринимательской деятельности. \r\n3.9. Обеспечивать рост прибыльности, конкурентоспособности и \r\nкачества товаров и услуг, повышение эффективности труда. \r\n3.10. Осуществлять координацию деятельности в рамках определенного \r\nнаправления (участка), анализ ее эффективности, принимать решения по \r\nнаиболее рациональному использованию выделенных ресурсов. \r\n3.11. Привлекать к решению задач консультантов и экспертов по \r\nразличным вопросам (правовым, техническим, финансовым и др.). \r\n3.12. Осуществлять руководство подчиненными ему работниками. \r\n\r\nIV. Права \r\n\r\nМенеджер имеет право: \r\n4.1. Знакомиться с проектами решений руководства предприятия, \r\nкасающимися его деятельности. \r\n4.2. Выносить на рассмотрение руководства предложения по улучшению \r\nдеятельности предприятия по находящимся в его компетенции вопросам. \r\n4.3. Подписывать и визировать документы в пределах своей \r\nкомпетенции. \r\n4.4. Сообщать непосредственному руководителю о всех выявленных в \r\nпроцессе исполнения своих должностных обязанностей недостатках в \r\nпредпринимательской деятельности предприятия (его структурных \r\nподразделениях) и вносить предложения по их устранению. \r\n4.5. Выносить на рассмотрение директора предприятия: \r\n- представления о назначении, перемещении и освобождении от \r\nзанимаемых должностей подчиненных ему работников; \r\n- предложения: \r\n- о поощрении отличившихся работников; \r\n- о наложении взысканий на нарушителей производственной и трудовой \r\nдисциплины. \r\n4.6. Требовать от администрации предприятия оказания содействия в \r\nисполнении своих должностных обязанностей и прав. \r\n\r\nV. Ответственность \r\n\r\nМенеджер несет ответственность: \r\n5.1. За неисполнение, ненадлежащее исполнение обязанностей, \r\nпредусмотренных настоящей инструкцией, в пределах, определенных трудовым \r\nзаконодательством Российской Федерации. \r\n5.2. За совершенные в процессе осуществления своей деятельности \r\nправонарушения - в пределах, определенных административным, уголовным и \r\nгражданским законодательством Российской Федерации. \r\n5.3. За причинение материального ущерба - в пределах, определенных \r\nтрудовым и гражданским законодательством Российской Федерации. \r\n\r\n\r\nДолжностная инструкция разработана в соответствии с ________________ \r\n(наименование, \r\n_____________________________. \r\nномер и дата документа) \r\n\r\n\r\n_________________________ \r\nРуководитель структурного подразделения (инициалы, фамилия) \r\n_________________________ \r\n(подпись) \r\n\r\n\" \" _____________ 20__г.');
